		"initScript": "\n\t\t\t\n\t\t\tvar __ERRORSTR__ = '';\n\n\t\t\tfunction checkDigitMask(m, p) {\n\t\t\t\tif (m.charAt(0) == '@' || m.indexOf('.') >= 0 || /^[0-9#*ABCD]*$/.test(m))\n\t\t\t\t\treturn \"\"; // ok\n\t\t\t\treturn p + \" 항목의 값이 유효하지 않습니다. 숫자나 #, *, A, B, C, D 값만 유효합니다. 자바스크립트 변수를 사용하려면 문자열의 첫번째 문자가 '@' 로 시작하거나 문자열 안에 '.' 문자가 포함되어 있어야 합니다.\"; // error\n\t\t\t}\n\t\t\tfunction checkDigitMaskWithoutVar(m, p) {\n\t\t\t\tif (/^[0-9#*ABCD]*$/.test(m))\n\t\t\t\t\treturn \"\"; // ok\n\t\t\t\treturn p + \" 항목의 값이 유효하지 않습니다. 숫자나 #, *, A, B, C, D 값만 유효합니다.\"; // error\n\t\t\t}\n\t\t\tfunction checkInputVariable(m, p) {\n\t\t\t\tif (m.charAt(0) == '@' || m.indexOf('.') >= 0)\n\t\t\t\t\treturn \"\"; // ok\n\t\t\t\treturn p + \" 항목의 값이 유효하지 않습니다. 문자열의 첫번째 문자가 '@' 로 시작하거나 문자열 안에 '.' 문자가 포함되어 있어야 합니다.\"; // error\n\t\t\t}\n\t\t\tfunction checkNumeric(v, p) {\n\t\t\t\tif (v.charAt(0) == '@' || v.indexOf('.') >= 0)\n\t\t\t\t\treturn \"\"; // ok\n\t\t\t\tif (/^[0-9]*$/.test(v))\n\t\t\t\t\treturn \"\"; // ok\n\t\t\t\treturn p + \" 항목의 값이 유효하지 않습니다. 숫자만 입력가능합니다. 자바스크립트 변수를 사용하려면 문자열의 첫번째 문자가 '@' 로 시작하거나 문자열 안에 '.' 문자가 포함되어 있어야 합니다.\"; // error\n\t\t\t}\n\t\t\tfunction clrError() {\n\t\t\t\t__ERRORSTR__ = '';\n\t\t\t}\n\t\t\tfunction setError(estr) {\n\t\t\t\tif (estr === \"\") return;\n\t\t\t\tif (__ERRORSTR__ === \"\")\n\t\t\t\t\t__ERRORSTR__ = estr;\n\t\t\t\telse\n\t\t\t\t\t__ERRORSTR__ += \"|\" + estr;\n\t\t\t}\n\t\t\tfunction error() {\n\t\t\t\treturn __ERRORSTR__;\n\t\t\t}\n\t\t\t\n\t\t",
