					"description": "\n\t          SmartIVR 멘트 데이터 포맷입니다.\n\t          L : innerTTS 기능을 사용하여 텍스트를 그대로 읽어줍니다.\n\t          V : 멘트파일을 재생합니다.\n\t          N : 연속된 숫자를 읽어줍니다. (1234 => 일이삼사)\n\t          Y : YYYY, YYYY/MM, YYYY/MM/DD 형태의 텍스트를 읽어줍니다.\n\t          M : MM, MM/DD 형태의 텍스트를 읽어줍니다.\n\t          D : DD 형태의 텍스트를 읽어줍니다.\n\t          H : HH, HH:MM, HH:MM:SS 형태의 텍스트를 읽어줍니다. (12시 기준)\n\t          F : HH, HH:MM, HH:MM:SS 형태의 텍스트를 읽어줍니다. (24시 기준)\n\t          B : MM:SS, SS 형태의 텍스트를 읽어줍니다.\n\t          S : SS 형태의 텍스트를 읽어줍니다.\n\t          A : 금액을 읽어줍니다. 소수점과 +,- 까지 판단하여 플레이합니다. (소수점,+,-는 해당하는 멘트파일이 innerTTS 경로에 있어야 합니다) (111 => 일천일백일십)\n\t          C : 금액을 읽어줍니다. 소수점과 +,- 까지 판단하여 플레이합니다. (소수점,+,-는 해당하는 멘트파일이 innerTTS 경로에 있어야 합니다) (111 => 천백십)\n\t          O : 숫자를 읽어줍니다. (하나, 둘, 셋, ...)\n\t          Q : 숫자를 읽어줍니다. (한, 두, 세, ...)\n\t          W : 요일을 안내합니다. (일요일, 월요일, 화요일, ...)\n\t          + : plus, minus 멘트를 재생합니다.\n\t        "
